import React, { Component } from 'react';
import './Header.css';

const rdbAlertLogo = require('../../Assets/Assets/logo_2.png');
const user = require('../../Assets/Assets/user.png');

class Header extends Component {
  render() {
    return (
      <header>
        <div className="logo">
          <img src={rdbAlertLogo} alt="rdbAlert-logo" />
        </div>
        <div>
          <h4>DASHBOARD</h4>
        </div>
        <div className="user">
          <button type="submit">
            <img src={user} alt="user" />
            User Settings
          </button>
        </div>
      </header>
    );
  }
}
export default Header;
